    false,nt"url": null,nt"notes": "The TIGER/Line shapefiles and related database
    files (.dbf) are an extract of selected geographic and cartographic information
    from then               U.S. Census Bureau's Master Address File / Topologically
    Integrated Geographic Encoding and Referencing (MAF/TIGER) Database (MTDB).  The
    MTDB representsn               a seamless national file with no overlaps or gaps
    between parts, however, each TIGER/Line shapefile is designed to stand alone as
    an independent datan               set, or they can be combined to cover the entire
    nation.nn               Combined Statistical Areas (CSAs) are defined by the Office
    of Management and Budget (OMB) and consist of two or more adjacent Core Based Statisticaln
                  Areas (CBSAs) that have significant employment interchanges.  The
    CBSAs that combine to create a CSA retain separate identities within the larger
    CSA.n               Because CSAs represent groupings of CBSAs, they should not be
    ranked or compared with individual CBSAs.  nn               The CSA boundaries are
    those defined by OMB based on the 2010 Census and published in 2013.  n            ",nt"license_title":
